import logo from "./logo.svg";
import "./App.css";
import Datas from "./data.json";
import Infos from "./example_data.json";

function App() {
  const info = Infos.map((Info) => (
    <ul key={Info.id}>
      <li>
        <h1>Name {Info.name}</h1>
      </li>
      <li>
        <h3>Categories : {Info.categories}</h3>
      </li>
      <li>
        <h3>Image</h3>
        <img src={Info.profile_image_url} alt={"logo"} width="250" />
      </li>
      Images:
      {/* <img src={Info.images[2]} alt={"logo"} width="50" /> */}
      {Info.images.forEach((item, index) => {
        <li>
          <img src={item} width="50" />
        </li>;
        console.log(item, index);
      })}
      <img src={item} width="50" />;
    </ul>
  ));
  const test = Datas.map((data) => (
    <ul key={data.id}>
      <li> name{data.color}</li>
      <li>{data.value}</li>
      <br />
    </ul>
  ));

  console.log();
  return (
    <div className="App">
      <h1>APP</h1>
      {info}
    </div>
  );
}

export default App;
